import React from 'react';

const About = () => {
    return (
        <div>
            <h1>About Me</h1>
            <p>
                Welcome to my portfolio! I am an artist and designer with a passion for creating detailed and innovative drawings across various fields. 
                My work includes Process, Mechanical, HVAC, Electronics, and 3D designs. 
                I strive to combine creativity with technical skills to deliver high-quality results.
            </p>
            <p>
                In this portfolio, you will find examples of my work, my design process, and how I approach each project. 
                Thank you for visiting, and I hope you enjoy exploring my creations!
            </p>
        </div>
    );
};

export default About;
